function SideVideo(props) {

  const handleVideoClick = () => {
    // For example, if you want to redirect to another page:
    window.location.href = props.videoLink; // Assuming you pass a 'videoLink' prop with the URL
  };

  return (
    <li className="side-video__section__item" onClick={handleVideoClick} style={{cursor: 'pointer'}}>
      <section className="side-video__img-section">
        <img className="side-video__img" src={props.image} alt="first video" />
      </section>
      <section className="side-video__description">
        <h5 className="side-video__title">{props.title}</h5>
        <p className="side-video__channel">{props.channel}</p>
      </section>
    </li>
  );
}

export default SideVideo;
